    submitResgiter: function () {
        var form = $('#register');
        $('.btnRegister').click(function () {
            if (REGISTER_OPEN != 0) {
                $.ajax({
                    url: form.data('url'),
                    type: 'POST',
                    dataType: 'JSON',
                    data: form.serialize(),
                    beforeSend: function (xhr, settings) {
                        Global.disabledDiv();
                        $('#process').modal({
                            backdrop: 'static',
                            keyboard: false
                        });
                    },
                    success: function (response, xhr) {
                        if(xhr.status != 200) {
                            $('#fail').find('.modal-title').html('Thông báo!');
                            Global.showError({mess: "Hệ thống đang chịu tải cao, xin vui lòng thử lại"});
                        }
                        if (response.status) {
                            window.location.hash = 'success';
                            $('body').removeClass('modal-open')
                                .addClass('form-success')
                                .html(response.dataHtml);

                            localforage.setItem('formSuccess', response.dataHtml);
                        } else {
                            $('#fail').find('.modal-title').html('Thông báo!');
                            Global.showError(response.errors);
                        }
                    },
                    error: function (xhr, status, error) {
                        $('#fail').find('.modal-title').html('Thông báo!');
                        Global.showError({mess: "Hệ thống đang chịu tải cao, xin vui lòng thử lại"});
                    }
                });
            } else {
                $('#fail').find('.registerBack').html('Đóng');
                $('#fail').find('.registerBack').removeClass('registerBack').attr('data-dismiss', 'modal');
                Global.showError({mess: "Thời gian đăng ký phiếu tiêm vắc xin Pentaxim 5 trong 1 bắt đầu từ 09:00 giờ sáng ngày 08/03/2016"});
            }

        });
    },
    showError: function (errors) {
        var modalBody = '';
        $.each(errors, function (key, value) {
            modalBody += '<p>' + value + '</p>';

        });
        $('#process').modal('hide');
        $('#fail .modal-body').html(modalBody);
        $('#fail').modal({
            backdrop: 'static',
            keyboard: false
        });

        $('.registerBack').click(function () {
            
            // disable thông báo reload của trình duyệt
            $(window).unbind('beforeunload');
            location.reload(true);
        });
    },
    checkRegisterStatus: function (id) {
        var interval = setInterval(function () {
            $.ajax({
                url: REGISTER_CHECK_URL,
                dataType: 'json',
                type: 'post',
                data: {id: id},
                success: function (response) {
                    switch (response.status) {
                        case REGISTER_STATUS_APPROVED:
                            clearInterval(interval);
                            window.location = response.url;
                            break;
                        case REGISTER_STATUS_REJECT:
                            clearInterval(interval);
                            Global.showError(response.errors);
                            break;
                    }
                },
                error: function () {
                    clearInterval(interval);
                    $('#fail').find('.modal-title').html('Lỗi hệ thống');
                    Global.showError({mess: "Hệ thống đang quá tải, xin vui lòng thử lại"});
                }
            });
        }, 30000);
    },
    validateBirthDay: function () {
        var dtDay = $('#VaccineDay').val().length >= 2 ? $('#VaccineDay').val() : '0' + $('#VaccineDay').val(),
                dtMonth = $('#VaccineMonth').val().length >= 2 ? $('#VaccineMonth').val() : '0' + $('#VaccineMonth').val(),
                dtYear = $('#VaccineYear').val(),
                dateStr = dtYear + '/' + dtMonth + '/' + dtDay,
                date = new Date(dateStr);

        function parseDate(date) {
            var date = String(date);
            var y = date.substr(0, 4),
                m = date.substr(4, 2),
                d = date.substr(6, 2);
            return new Date(y + '/' + m + '/' + d);
        }

        if (REGISTER_OPEN != 0) {
            if (parseDate(BIRTH_START) > date || date > parseDate(BIRTH_END)) {
                Global.showError({mess: "Rất tiếc, tuổi của trẻ không hợp lệ, vắc xin này chỉ dành cho trẻ từ 2-24 tháng tuổi"});
                return false;
            } else {
                $('#confirm').modal({
                    backdrop: 'static',
                });
            }
        } else {
            Global.showError({mess: 'Dữ liệu của bạn được nhập trước giờ đăng ký. Vui lòng nhập lại!'});
        }
    },
